import {
  LEVEL_THEMES,
  PLACEMENT_TYPE_FLOUR,
  PLACEMENT_TYPE_GOAL,
  PLACEMENT_TYPE_HERO,
  PLACEMENT_TYPE_WATER,
  PLACEMENT_TYPE_WATER_PICKUP,
  PLACEMENT_TYPE_MINERAL_GOLD,
  PLACEMENT_TYPE_MINERAL_COPPER,
} from "../helpers/consts";

const level = {
  theme: LEVEL_THEMES.EARTH,  // Theme of level sets background
  tilesWidth: 24,             // Size of Level
  tilesHeight: 100,           // Size of Level         
  RNG:[                       // Variable for the RNG to fill in our map
    {depthStart: 2, depthEnd: 16, odds: 20, type: PLACEMENT_TYPE_WATER},
  ],
  placements: [
    { x: 1, y: 0, type: PLACEMENT_TYPE_HERO },
    { x: 1, y: 2, type: PLACEMENT_TYPE_MINERAL_COPPER },
    { x: 1, y: 2, type: PLACEMENT_TYPE_MINERAL_ZINC },
    { x: 1, y: 2, type: PLACEMENT_TYPE_MINERAL_GOLD },
    { x: 1, y: 2, type: PLACEMENT_TYPE_MINERAL_LITHIUM },
    { x: 1, y: 2, type: PLACEMENT_TYPE_MINERAL_NEODYMIUM },
    { x: 1, y: 2, type: PLACEMENT_TYPE_MINERAL_YTTRIUM },
  ],
};

export default level;
